import React from 'react';
import productImage1 from '../assets/css/back.jpg';
import productImage2 from '../assets/css/back.ipg';
import KitchenSinkExample from '../assets/cssProducts';
import './ProductsMain.css'; 

export default function ProductsMain() {
  return (
      <div className='card-container'>
      <h1>TOP SELLER</h1>
      <div className='card-row1'>
      <KitchenSinkExample productImage={productImage1} />
      <KitchenSinkExample productImage={productImage2} />
      <KitchenSinkExample productImage={productImage2} />
      <KitchenSinkExample productImage={productImage2} />
      </div>
      <h1>TOP SELLER</h1>
      <div className='card-row2'>
        <KitchenSinkExample productImage={productImage1} />
        <KitchenSinkExample productImage={productImage2} />
        <KitchenSinkExample productImage={productImage2} />
        <KitchenSinkExample productImage={productImage2} />
      </div>
    </div>
  );
}
